import React from 'react';
// import {} from './styles';
// import AppLayout from '../components/AppLayout';
import HomeLayout from '../components/HomeLayout';

const Home = () => (
  <HomeLayout>
    <div className="container">
      <>
        <h1>김동진</h1>
      </>
    </div>
  </HomeLayout>
);

export default Home;
